import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
    resultado: {
        flex:1,
        marginTop:15,
        paddingTop:20,
        borderRadius:100,
        alignItems:"center",
        width:"100%",
    },
    txtResultado: {
        fontSize:48,
        color:"#FF0043",
        fontWeight:"bold",
    },
    txtMensagem: {
        fontSize:18,
        color:"#FF0043",
        fontWeight:"bold",
    },
});

export default styles
